INSERT INTO `quote` (`id`, `id_book`, `sentence`, `audio_path`, `created_at`, `updated_at`) VALUES
(101, '11', 'Don\'t let the stories and pretty lights fool you, boys. Religion is darkness', 'app/audio_synthesis/101.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(102, '11', 'Hunger can change everything you thought you knew about yourself', 'app/audio_synthesis/102.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(103, '11', 'Because, believing in everything at once is the same thing as believing in nothing', 'app/audio_synthesis/103.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(104, '11', 'I had no idea a living being could sustain so much injury and go on living', 'app/audio_synthesis/104.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(105, '11', 'And so it goes with God', 'app/audio_synthesis/105.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(106, '11', 'The lower you are, the higher your mind will want to soar', 'app/audio_synthesis/106.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(107, '11', 'Yes. The story with animals is the better story', 'app/audio_synthesis/107.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(108, '11', 'You might think I lost all hope at that point. I did', 'app/audio_synthesis/108.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(109, '11', 'Faith in God is an opening up, a letting go, a deep trust, a free act of love', 'app/audio_synthesis/109.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(110, '11', 'Survival had to start with me. In my experience, a castaway’s worst mistake is to hope too much and do too little', 'app/audio_synthesis/110.wav', '2023-08-02 11:02:30', '2023-08-02 12:12:43'),
(111, '12', 'Forget him. He\'s not the right doctor for you.', 'app/audio_synthesis/111.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(112, '12', 'Even when I was your nursemaid, Mordo, I still accomplished all that was required of me', 'app/audio_synthesis/112.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(113, '12', 'Don\'t get used to it. This hospital didn\'t hire me to handle ordinary cases', 'app/audio_synthesis/113.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(114, '12', 'I almost forgot how grumpy you get when you miss your morning coffee and colonic', 'app/audio_synthesis/114.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(115, '12', 'Save it, I\'ll be lucky if I can open a door, let alone hold a scalpel', 'app/audio_synthesis/115.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(116, '12', 'For the cure you seek is within you', 'app/audio_synthesis/116.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(117, '12', 'This is not about your hands. It never has been', 'app/audio_synthesis/117.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(118, '12', 'So many innocent lives, and four of our own. our brothers. Our sisters. Their bodies lie at your feed, Mordo', 'app/audio_synthesis/118.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(119, '12', 'Come. The gateway is now open. Spread into the night. Feast. Multiply. For this world is ours.', 'app/audio_synthesis/119.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(120, '12', 'Exactly. And with it, you can unlock the power that dwells within you', 'app/audio_synthesis/120.wav', '2023-08-02 11:16:29', '2023-08-02 12:12:43'),
(121, '13', 'If you put your mind to it, you can accomplish anything.', 'app/audio_synthesis/121.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(122, '13', 'Since you\'re new here, I\'m gonna cut you a break... today. So, why don\'t you make like a tree and get out of here?', 'app/audio_synthesis/122.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(123, '13', 'I think it\'s a major embarrassment having an uncle in prison.', 'app/audio_synthesis/123.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(124, '13', 'I guess you guys aren\'t ready for that, yet. But your kids are gonna love it.', 'app/audio_synthesis/124.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(125, '13', 'Oh, my God, they found me, I don\'t know how, but they found me. Run for it Marty.', 'app/audio_synthesis/125.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(126, '13', 'It\'s already mutated into human form. Shoot it.', 'app/audio_synthesis/126.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(127, '13', 'Look. There\'s a rhythmic ceremonial ritual coming up.', 'app/audio_synthesis/127.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(128, '13', 'All right, kid. You stick to your father like glue and make sure he takes her to that dance.', 'app/audio_synthesis/128.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(129, '13', 'What about all that talk about screwing up future events, the space-time continuum?', 'app/audio_synthesis/129.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(130, '13', 'Tell me, Future Boy, who\'s President of the United States in 1985?', 'app/audio_synthesis/130.wav', '2023-08-02 11:22:43', '2023-08-02 12:12:43'),
(131, '14', 'As long as you can find yourself, you’ll never starve', 'app/audio_synthesis/131.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(132, '14', 'You don’t forget the face of the person who was your last hope', 'app/audio_synthesis/132.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(133, '14', 'Why don’t you just be yourself? … No one can help but admire your spirit', 'app/audio_synthesis/133.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(134, '14', 'My nightmares are usually about losing you. I’m okay once I realize you’re here', 'app/audio_synthesis/134.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(135, '14', 'Destroying things is much easier than making them', 'app/audio_synthesis/135.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(136, '14', 'Remember, we’re madly in love, so it’s all right to kiss me anytime you feel like it', 'app/audio_synthesis/136.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(137, '14', 'Stupid people are dangerous', 'app/audio_synthesis/137.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(138, '14', 'I always channel my emotions into my work. That way, I don’t hurt anyone but myself', 'app/audio_synthesis/138.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(139, '14', 'I am not pretty. I am not beautiful. I am as radiant as the sun.', 'app/audio_synthesis/139.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(140, '14', 'You’ve got about as much charm as a dead slug', 'app/audio_synthesis/140.wav', '2023-08-02 11:26:28', '2023-08-02 12:12:43'),
(141, '15', 'It is not despair, for despair is only for those who see the end beyond all doubt. We do not.', 'app/audio_synthesis/141.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(142, '15', 'It is useless to meet revenge with revenge; it will heal nothing', 'app/audio_synthesis/142.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(143, '15', 'And then her heart changed, or at least she understood it; and the winter passed, and the sun shone upon her', 'app/audio_synthesis/143.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(144, '15', 'All’s well that ends better', 'app/audio_synthesis/144.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(145, '15', 'His grief he will not forget; but it will not darken his heart, it will teach him wisdom', 'app/audio_synthesis/145.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(146, '15', 'It is a comfort not to be mistaken at all points. Do I not know it only too well!', 'app/audio_synthesis/146.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(147, '15', 'He that breaks a thing to find out what it is has left the path of wisdom', 'app/audio_synthesis/147.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(148, '15', 'To me it would not seem that a Steward who faithfully surrenders his charge is diminished in love or in honour', 'app/audio_synthesis/148.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(149, '15', 'The treacherous are ever distrustful', 'app/audio_synthesis/149.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(150, '15', 'It is perilous to study too deeply the arts of the Enemy, for good or for ill', 'app/audio_synthesis/150.wav', '2023-08-02 11:32:34', '2023-08-02 12:12:43'),
(151, '16', 'Faith – acceptance of which we imagine to be true, that which we cannot prove', 'app/audio_synthesis/151.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(152, '16', 'Telling someone about what a symbol means is like telling someone how music should make them feel', 'app/audio_synthesis/152.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(153, '16', 'History is always written by the winners. When two cultures crash, the loser is obliterated, and the winner writes the history books', 'app/audio_synthesis/153.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(154, '16', 'Life is filled with secrets. You can’t learn them all at once', 'app/audio_synthesis/154.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(155, '16', 'The blind see what they want to see', 'app/audio_synthesis/155.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(156, '16', 'Today is today. But there are many tomorrows', 'app/audio_synthesis/156.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(157, '16', 'When a question has no correct answer, there is only one honest response', 'app/audio_synthesis/157.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(158, '16', 'What really matters is what you believe', 'app/audio_synthesis/158.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(159, '16', 'There is your truth and there is my truth', 'app/audio_synthesis/159.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(160, '16', 'for the universal truth is does not exist', 'app/audio_synthesis/160.wav', '2023-08-02 11:37:34', '2023-08-02 12:12:43'),
(161, '17', 'Day one, greenie, rise and shine', 'app/audio_synthesis/161.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(162, '17', 'We get out now, or we die trying', 'app/audio_synthesis/162.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(163, '17', 'Everything started changing the moment you showed up.', 'app/audio_synthesis/163.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(164, '17', 'The rules are the only thing that have ever held us together', 'app/audio_synthesis/164.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(165, '17', 'You don’t get it. We’re already dead', 'app/audio_synthesis/165.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(166, '17', 'What if we were sent here for a reason?', 'app/audio_synthesis/166.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(167, '17', 'Most importantly, never go beyond those walls', 'app/audio_synthesis/167.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(168, '17', 'That’s the maze. It never takes the same shape twice', 'app/audio_synthesis/168.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(169, '17', 'If you want to stay here, I need to know that you’re going to follow the rules', 'app/audio_synthesis/169.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(170, '17', 'You’re so close to the truth. Don’t you want to know why this all happened?', 'app/audio_synthesis/170.wav', '2023-08-02 11:40:04', '2023-08-02 12:12:43'),
(171, '18', 'I just wanted to take another look at you', 'app/audio_synthesis/171.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(172, '18', 'Maybe it\'s time to let the old ways die', 'app/audio_synthesis/172.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(173, '18', 'All you gotta do is trust me', 'app/audio_synthesis/173.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(174, '18', 'I\'m off the deep end, watch as I dive in', 'app/audio_synthesis/174.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(175, '18', 'I just wanna take another look at you', 'app/audio_synthesis/175.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(176, '18', 'You know, it\'s like, I dunno... I think the whole thing\'s pretty much made up', 'app/audio_synthesis/176.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(177, '18', 'It\'s the way I felt when I met you. I just wanted to take another look at you', 'app/audio_synthesis/177.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(178, '18', 'We\'re far from the shallow now', 'app/audio_synthesis/178.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(179, '18', 'I always thought it was the other way around. I thought it was, like, you inspire me', 'app/audio_synthesis/179.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(180, '18', 'Takes a lot to change, a little to say', 'app/audio_synthesis/180.wav', '2023-08-02 11:43:09', '2023-08-02 12:12:43'),
(181, '19', 'Hogwarts will always be there to welcome you home', 'app/audio_synthesis/181.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(182, '19', 'It is not our abilities that show what we truly are. It is our choices', 'app/audio_synthesis/182.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(183, '19', 'The boy who lived come to die.', 'app/audio_synthesis/183.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(184, '19', 'The last enemy that shall be destroyed is death', 'app/audio_synthesis/184.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(185, '19', 'Words are, in my not-so-humble opinion, our most inexhaustible source of magic', 'app/audio_synthesis/185.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(186, '19', 'The world we have entered will not long tolerate your indifference', 'app/audio_synthesis/186.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(187, '19', 'It\'s the quality of one\'s convictions that determines success, not the number of followers', 'app/audio_synthesis/187.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(188, '19', 'Happiness can be found even in the darkest of times, if one only remembers to turn on the light', 'app/audio_synthesis/188.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(189, '19', 'The ones that love us never really leave us', 'app/audio_synthesis/189.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(190, '19', 'I\'ve always wanted to use that spell', 'app/audio_synthesis/190.wav', '2023-08-02 11:49:52', '2023-08-02 12:12:43'),
(191, '20', 'Get busy living, or get busy dying', 'app/audio_synthesis/191.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(192, '20', 'Hope is a good thing, maybe the best of things, and no good thing ever dies', 'app/audio_synthesis/192.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(193, '20', 'Fear can hold you prisoner, hope can set you free', 'app/audio_synthesis/193.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(194, '20', 'It takes a strong man to save himself, and a great man to save another', 'app/audio_synthesis/194.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(195, '20', 'I have to remind myself that some birds aren\'t meant to be caged', 'app/audio_synthesis/195.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(196, '20', 'I guess it comes down to a simple choice, really. Get busy living or get busy dying', 'app/audio_synthesis/196.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(197, '20', 'Hope is a dangerous thing. Hope can drive a man insane', 'app/audio_synthesis/197.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(198, '20', 'Redemption is something that\'s earned', 'app/audio_synthesis/198.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(199, '20', 'I hope the Pacific is as blue as it has been in my dreams. I hope', 'app/audio_synthesis/199.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43'),
(200, '20', 'There\'s something inside they can\'t get to, that they can\'t touch. That\'s yours', 'app/audio_synthesis/200.wav', '2023-08-02 11:55:56', '2023-08-02 12:12:43');
